import React from "react";
import { useLayout } from "./../contexts/LayoutContext";
import { TabContent, TabPane } from "reactstrap";

//Import Components
import Profile from "./Profile";
import Chats from "./Chats";
import Groups from "./Groups";
import Contacts from "./Contacts";
import Settings from "./Settings";

const ChatLeftSidebar: React.FC = () => {
  const { activeTab } = useLayout();

  return (
    <div className="chat-leftsidebar mr-lg-1">
      <TabContent activeTab={activeTab}>
        <TabPane tabId="profile" id="pills-user">
          <Profile />
        </TabPane>

        <TabPane tabId="chat" id="pills-chat">
          <Chats />
        </TabPane>

        <TabPane tabId="group" id="pills-groups">
          <Groups />
        </TabPane>

        <TabPane tabId="contacts" id="pills-contacts">
          <Contacts />
        </TabPane>

        <TabPane tabId="settings" id="pills-setting">
          <Settings />
        </TabPane>
      </TabContent>
    </div>
  );
};

export default ChatLeftSidebar;
